==简介==

本模板提供《[[少女与战车]]》剧场版中大学选拔队百慕大三姐妹的小队的[[矢量图]]Logo，每个Logo会链接到对应的角色页面。

==使用方法==

<pre>{{Gupbermudaicon|角色名|size=（默认25px，可不填。）}}</pre>

==举例==

{| class="wikitable"
|-
! 代码 !! 结果
|-
| <nowiki>{{Gupbermudaicon|安昙}}</nowiki> || {{Gupbermudaicon|安昙}}
|-
| <nowiki>{{Gupbermudaicon|Azumi}}</nowiki> || {{Gupbermudaicon|Azumi}}
|-
| <nowiki>{{Gupbermudaicon|Azumi|size=50px}}</nowiki> || {{Gupbermudaicon|Azumi|size=50px}}
|-
| <nowiki>{{Gupbermudaicon|爱里寿}}</nowiki> || {{Gupbermudaicon|爱里寿}}
|}

==全部队员名称==

包含中文名，日语名，以及英文名，'''不区分大小写。'''只要包含队员名称就可以返回对应的图标，比如<Nowiki>{{Gupbermudaicon|惠美小队}}</Nowiki>就会显示惠美小队的Logo{{Gupbermudaicon|惠美小队}}。

